import { Card } from "react-bootstrap";

<link rel="stylesheet" href="./App.css" />;

const Song = (props) => {
  return (
    <Card>
      <img src={props.song.img} alt={props.song.title}></img>
      <h3 style={{ paddingLeft: "0.2rem" }}>{props.song.title}</h3>
      <h5 style={{ paddingLeft: "0.2rem" }}>by {props.song.artist}</h5>
      <p style={{ paddingLeft: "0.2rem" }}>
        {props.song.genre} | {props.song.year} | {props.song.length}
      </p>
      <button class="btn btn-custom" style={{ padding: "0.2rem" }}>
        Add to Favorites
      </button>
    </Card>
  );
};

export default Song;
